// }

function Nav(props) {
    return (
      <ul className="navbar nav-tabs navbar-expand-md navbar-dark bg-dark">
        <div className="container-fluid">
        <div className="navbar-brand">My Google Books</div>
        <p className ="headline"> Search and Save your Books! </p>
        <div className="navbar-header">
        <button type="button" className="navbar-toggler" data-toggle="collapse" data-target="#navbarCollapse">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarCollapse">
        <li className="navbar">

          <a
            href="#home"
            onClick={() => props.handlePageChange("Home")}
            className={props.currentPage === "Home" ? "nav-link active" : "nav-link"}
          >
            Home

          </a>       
        </li>
        <li className="navbar">

          <a
            href="#books"
            onClick={() => props.handlePageChange("Books")}
            className={props.currentPage === "Books" ? "nav-link active" : "nav-link"}
          >
            My Books
          </a>

        </li>
        </div>
        </div>
        </div>
      </ul>

    );
  }



export default Nav;
